import React, { Component } from 'react';

class Frist extends Component {
    state = {}
    render() {
        return (
            <div>
                <h1>react</h1>
                <h1>Hello, world!</h1>
                <h2>It is {new Date().toLocaleTimeString()}.</h2>
            </div>
        );
    }
}

export default Frist;
